import React from "react";
import { Link } from "react-router-dom";
import ReactPlayer from "react-player";

export default function PruevaGratis() {
  return (
    <div
      className="row"
      style={{ width: "80%", margin: "auto", justifyContent: "center" }}
    >
      <div className="col-lg-8 col-md-8 col-sm-12 p-0 m-auto ">
        <div className="player-wrapper">
          <ReactPlayer
            className="react-player"
            url="https://vimeo.com/403129889"
            // light="./assets/img/player123.png"
            width="100%"
            playing={false}
            controls
          />
        </div>
      </div>
      <div
        style={{ textAlign: "center" }}
        className="col-lg-4 col-md-4 col-sm-12 p-0  m-auto "
      >
        <h4>
          Regístrate
          <strong> y comprueba si estás listo para la </strong>
          Universidad de Lima.
        </h4>
        <Link
          style={{
            color: "#FF4900",
            borderColor: "#FF4900",
            borderRadius: "0px",
            textTransform: "uppercase",
          }}
          className="btn btn-lg shadow-lg my-4 mx-auto"
          aria-pressed="true"
          to="/register"
        >
          Prueba Gratis
        </Link>
      </div>
    </div>
  );
}
